function signIn(){let e={email:document.getElementById("sign-in-email").value,password:document.getElementById("sign-in-password").value,gcap:grecaptcha.getResponse(0)};$.ajax({url:"https://api.startapped.com/v1/account/login",headers:{"Content-Type":"application/json"},method:"POST",dataType:"json",data:JSON.stringify(e),success:function(e){saveCredentials(e.credentials,document.getElementById("sign-in-remember").checked),window.location.replace("/hub")},error:function(e,n,a){showSnackbar(JSON.parse(e.responseText).message),grecaptcha.reset()}})}